1. In the tStudio checking view, the person who translated the first chunk of text should read their translation aloud.
2. The partner should read long in the GLT, thinking specifically about accuracy. Then, discuss the text, referring to any of the book package components for translation assistance.
3. The one who translated the text should make any agreed corrections to the text, directly in the tStudio checking view. Any words or phrases where agreement could not be reached should be noted for further discussion with the larger team in the Key Word Check step.
4. When the team is satisfied, the translator should read the translated text aloud again, this time with the partner just listening for clear, natural language
5. Discuss the text, referring to the target audience and rules for the translation as defined in the translation brief. Again, the translator makes any agreed changes to the text.
6. The peer team then proceeds to the next chunk of text and repeats these steps until the chapter is finished.
7. Alternatively, the entire chapter could be reviewed for accuracy first, then reviewed a second time for naturalness. The peer team can decide which is most useful to them.
