1. Consider the chunk one more time for a few minutes (and any book package components if necessary), thinking in terms of how you will express the text in the target language. If you recorded the oral pre-translation, listen to such for ideas you want to remember.
2. Switch to the drafting panel and when you are ready, write out the translation in the target language as naturally as possible. Do not refer to the source text; draft it from memory. The first goal is to translate in natural language. Accuracy will be worked into the text in subsequent steps. Spend 15 minutes or so on this step.
3. When you believe you have expressed the text as completely as possible, switch back to the checking panel and you will see your new text in the center column, ready for checking. 
4. NOTE: Blind drafting is not practical for all kinds of passages. For example, genealogies, or long lists of things, or measurements and dimensions are better simply translated directly from the GLT text. However, avoid the temptation to put too much into this category! Blind draft should be used everywhere possible to ensure that a natural language base is firmly set for the translation before accuracy concerns are addressed.
