1. Break the team down into pairs and assign each pair a chapter to work through
2. Work from top to bottom through the chapter looking at one book package resource at a time and discussing new things you are learning that help you understand the text and that impact the targeted translation. 
3. First, read each chunk and look at the GST text on the right to see how it adds to your understanding. Spend 30 minutes or so going through the whole chapter. Make notes on potential translation issues, ideas for important words, record any problems you find in GST, and also consider how you would teach this process step to others
4. Second, read again through each chunk, this time considering the translation questions for each. Discuss what additional insight you gain in understanding the text and noting potential translation issues and problems you see in the questions and things to remember for teaching this step. Spend 30 minutes or so working through the chapter
5. Third, read each chunk again and consider the translation words resource. Note additional learnings, ideas for translating important words, any problems with this book package resource, and things to remember for teaching this step. Spend 30-60 minutes on this activity.
6. Fourth, reach each chunk again, this time considering the translation notes. Note additional learnings, any problems with the resource, and ideas for teaching this step. Spend 30 minutes on this activity.
