1. Once the Key Word check is complete, the team should switch to the broader review of the chapters under consideration with the primary focus as overall consistency in translation decisions in all areas of CAN (clear, accurate, natural).
2. The text should first be consolidated into one tStudio application "master" to facilitate a top to bottom read-through of the translation. This master should be loaded into one person''s tStudio and said person should then make any edits to the text as the team agrees. 
3. At least two read-throughs should be made. The first is an uninterrupted read-though (slowly) where the team focuses on accuracy. Brief notes should be made by the team on anything a person might like to discuss as they listen to it being read. Look for areas of obvious inconsistency first. 
4. When the read-through is complete, the team should discuss each area for agreement/resolution, until all questions have been addressed and the team is satisfied. Record of important decisions should be made for the larger team and future translation work.
5. Prior areas of disagreement can be discussed again, if additional understanding was obtained via the readthrough that could help in resolution. However, do not spend much time on this if it is clear that disagreement remains. Make sure related notes are updated for checkers to reference in subsequent checking steps
6. The second read-through should be focused on clear and natural language. Again, read the text without interruption in a natural, unhurried manner, and the team should note any words or phrases for discussion.
7. When the read-through is complete, the team should discuss each area noted for agreement/resolution, until all questions have been addressed and the team is satisfied. Update records of any important decisions made for the larger team and future translation.
8. When all agreed edits have been made, the master copy should be loaded back onto each team member''s tStudio, and the team should proceed to the next set of chapters, repeating all the steps from Consume through Team Check.
