1. Take 10 minutes to now study your first assigned chunk using all the resources to understand it as clearly as possible. Set the text in your mind and think about how you could express it in natural language
2. Speak out loud the content of this chunk to your partner, without looking at the text, expressing as much of it as you can remember. Speak it naturally, but in the language of the source
3. Listen to your partner do the same with their chunk. The purpose here is just to speak it and help set it in your mind in preparation for blind drafting. No discussion, just speaking and listening. If the partner is not available for this step, anyone can serve in the listening role. The point of a listener is to create accountability to perform the step.
4. Look at the text again and consider for another 5 minutes how you would say this in the target language, according to the rules laid out in the translation brief for the type of language to be used. If you have a model translation to refer to, look at that too.
5. Again speak it out loud to your partner, this time in the target language. As much as you can remember, without looking at the text. The purpose here is setting in your mind a pre-translation in preparation for blind drafting. It may be helpful to speak this pre-translation into a recording device, to help remember good ideas for drafting the translation.
5. Listen to your partner do the same with their chunk. No discussion here, just speaking and listening
