1. When all peer teams have completed the peer check, the larger team working on the book should gather for a keyword check. If the book is very small, such that only one pair of translators is working on it, then at least two translators working on other books should be included in this check as well as the next checking step (Team Review), to ensure a broader review.
2. Beginning with the first chunk assigned, the team should use the tWords book package component as the means to examine the most weighty or problematic words in each chunk. the whole team should come to agreement on how to translate these words or phrases. 
3. Included in this discussion and words or phrases the peer team could not agree on in the previous checking step. 
4. The person who translated the text should make all agreed changes. Translation of any words or phrases which could not be agreed to by the team should be noted for future checking steps, and the translation should remain as is until the team can agree.
5. Any decisions made about the translation of key terms or difficult words/phrases should be documented in a database that all in the team can reference throughout the translation project. This will help streamline future translation discussions as well as ensure consistent treatment of these important terms.
